import React, {useState,useEffect} from "react"
import './App.css';

function App() {
  const [initialData, setInitialData] = useState([{}]);

  useEffect(() => {
    fetch("/home").then(
      response => response.json()).then(
      data => setInitialData(data))
  });
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <div>{initialData.name}</div>
    </div>
  );
}

export default App;
